description:
The "Eegun" collection by OgBe, created by multidisciplinary artist OgBe Meji, is a visionary art project inscribed on a rare Satoshi (Bitcoin), comprising 111 unique, hand-drawn artworks. Each piece blends historical, natural, spiritual, and cultural elements, drawing from Caribbean, American, and African influences, with characters expressing resilience through deliberate use or absence of color. The collection, set in a futuristic post-fiat, pre-revolution world, showcases artistic maturity and lays the groundwork for an upcoming ordinal series.
